    {
        $exploded = array_reverse(explode("\n", $this->text()));

        foreach ($exploded as $item) {
            $data = explode("\t", $item);
            $ee = explode('@', $data[3]);
            if (! User::where('number', $data[4])->exists() && (
                ! User::where('email', $data[3])->exists() || ! $data[3]
                )) {
                User::create([
                'name' => $data[1],
                'lastname' => $data[2],
                'login' => $ee[0] ?? time(),
                'email' => (bool) $data[3] ? $data[3] : null,
                'number' => $data[4],
                'password' => 'none',
            ]);
            }
        }
    }

